Enums in GraphQL are string constants grouped together to represent a set of possible values. Simple Rust enums can be converted to GraphQL enums by using a custom derive attribute: #[derive(juniper::GraphQLEnum)]
enum Episode { NewHope, Empire, Jedi,
} # fn main() {} Juniper converts all enum variants to uppercase, so the corresponding string values for these variants are NEWHOPE, EMPIRE, and JEDI, respectively. If you want to override this, you can use the graphql attribute, similar to how it works when defining objects : #[derive(juniper::GraphQLEnum)]
enum Episode { #[graphql(name="NEW_HOPE")] NewHope, Empire, Jedi,
} # fn main() {}

