enum StarWarsEpisode { #[graphql(deprecated="We don't really talk about this one")] ThePhantomMenace, #[graphql(name="NEW_HOPE")] NewHope, #[graphql(description="Arguably the best one in the trilogy")] Empire, Jedi,
} # fn main() {}

