#[derive(juniper::GraphQLObject)]
struct Human { id: String, home_planet: String,
} #[derive(juniper::GraphQLObject)]
struct Droid { id: String, primary_function: String,
} trait Character { fn id(&self) -> &str; // Downcast methods, each concrete class will need to implement one of these fn as_human(&self) -> Option<&Human> { None } fn as_droid(&self) -> Option<&Droid> { None }
} impl Character for Human { fn id(&self) -> &str { self.id.as_str() } fn as_human(&self) -> Option<&Human> { Some(&self) }
} impl Character for Droid { fn id(&self) -> &str { self.id.as_str() } fn as_droid(&self) -> Option<&Droid> { Some(&self) }
} juniper::graphql_interface!(<'a> &'a Character: () as "Character" where Scalar = <S> |&self| { field id() -> &str { self.id() } instance_resolvers: |_| { // The left hand side indicates the concrete type T, the right hand // side should be an expression returning Option<T> &Human => self.as_human(), &Droid => self.as_droid(), }
}); # fn main() {} The instance_resolvers declaration lists all the implementors of the given interface and how to resolve them. As you can see, you lose a bit of the point with using traits: you need to list all the concrete types in the trait itself, and there's a bit of repetition going on.

