If you can afford an extra database lookup when the concrete class is requested, you can do away with the downcast methods and use the context instead. Here, we'll use two hashmaps, but this could be two tables and some SQL calls instead: # use std::collections::HashMap;
#[derive(juniper::GraphQLObject)]
#[graphql(Context = Database)]
struct Human { id: String, home_planet: String,
} #[derive(juniper::GraphQLObject)]
#[graphql(Context = Database)]
struct Droid { id: String, primary_function: String,
} struct Database { humans: HashMap<String, Human>, droids: HashMap<String, Droid>,
} impl juniper::Context for Database {} trait Character { fn id(&self) -> &str;
} impl Character for Human { fn id(&self) -> &str { self.id.as_str() }
} impl Character for Droid { fn id(&self) -> &str { self.id.as_str() }
} juniper::graphql_interface!(<'a> &'a Character: Database as "Character" where Scalar = <S> |&self| { field id() -> &str { self.id() } instance_resolvers: |&context| { &Human => context.humans.get(self.id()), &Droid => context.droids.get(self.id()), }
}); # fn main() {} This removes the need of downcast methods, but still requires some repetition.

