Often, you might need a custom scalar that just wraps an existing type. This can be done with the newtype pattern and a custom derive, similar to how serde supports this pattern with #[serde(transparent)]. #[derive(juniper::GraphQLScalarValue)]
pub struct UserId(i32); #[derive(juniper::GraphQLObject)]
struct User { id: UserId,
} # fn main() {} That's it, you can now user UserId in your schema. The macro also allows for more customization: /// You can use a doc comment to specify a description.
#[derive(juniper::GraphQLScalarValue)]
#[graphql( transparent, // Overwrite the GraphQL type name. name = "MyUserId", // Specify a custom description. // A description in the attribute will overwrite a doc comment. description = "My user id description",
)]
pub struct UserId(i32); # fn main() {}

