For more complex situations where you also need custom parsing or validation, you can use the graphql_scalar! macro. Typically, you represent your custom scalars as strings. The example below implements a custom scalar for a custom Date type. Note: juniper already has built-in support for the chrono::DateTime type via chrono feature, which is enabled by default and should be used for this purpose. The example below is used just for illustration. Note : the example assumes that the Date type implements std::fmt::Display and std::str::FromStr. # mod date { # pub struct Date; # impl std::str::FromStr for Date{ # type Err = String; fn from_str(_value: &str) -> Result<Self, Self::Err> { unimplemented!() }
# }
# // And we define how to represent date as a string.
# impl std::fmt::Display for Date {
# fn fmt(&self, _f: &mut std::fmt::Formatter) -> std::fmt::Result {
# unimplemented!()
# }
# }
# } use juniper::{Value, ParseScalarResult, ParseScalarValue};
use date::Date; juniper::graphql_scalar!(Date where Scalar = <S> { description: "Date" // Define how to convert your custom scalar into a primitive type. resolve(&self) -> Value { Value::scalar(self.to_string()) } // Define how to parse a primitive type into your custom scalar. from_input_value(v: &InputValue) -> Option<Date> { v.as_scalar_value::<String>() .and_then(|s| s.parse().ok()) } // Define how to parse a string value. from_str<'a>(value: ScalarToken<'a>) -> ParseScalarResult<'a, S> { <String as ParseScalarValue<S>>::from_str(value) }
}); # fn main() {}

