Let's start with a minimal schema and just get a GraphQL endpoint up and running. We use mount to attach the GraphQL handler at /graphql. The context_factory function will be executed on every request and can be used to set up database connections, read session token information from cookies, and set up other global data that the schema might require. In this example, we won't use any global data so we just return an empty value. extern crate juniper;
extern crate juniper_iron;
extern crate iron;
extern crate mount; use mount::Mount;
use iron::prelude::*;
use juniper::EmptyMutation;
use juniper_iron::GraphQLHandler; fn context_factory(_: &mut Request) -> IronResult<()> { Ok(())
} struct Root; #[juniper::object]
impl Root { fn foo() -> String { "Bar".to_owned() }
} # #[allow(unreachable_code, unused_variables)]
fn main() { let mut mount = Mount::new(); let graphql_endpoint = GraphQLHandler::new( context_factory, Root, EmptyMutation::<()>::new(), ); mount.mount("/graphql", graphql_endpoint); let chain = Chain::new(mount); # return; Iron::new(chain).http("0.0.0.0:8080").unwrap();
}

